import React, { useState } from 'react';
import axios from 'axios';
import './prediccion.css';

export default function PrediccionReserva() {
  const [formData, setFormData] = useState({
    numAdultos: 2,
    numNinos: 0,
    tipoHabitacion: 'Doble',
    precioHabitacion: 150,
    duracionEstadia: 3,
    diaSemanaCheckIn: 'Monday',
    mesCheckIn: 4,
    antiguedadReserva: 30
  });

  const [resultado, setResultado] = useState(null);
  const [cargando, setCargando] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    // Si es número, se fuerza que no sea menor a 0
    if (e.target.type === 'number') {
      setFormData({ ...formData, [name]: Math.max(0, Number(value)) });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setCargando(true);
    setResultado(null);

    try {
      const res = await axios.post('http://localhost:4040/api/prediccion', formData);
      setResultado(res.data);
    } catch (err) {
      console.error('Error en la predicción', err);
      setResultado('Error al conectar con el servidor.');
    } finally {
      setCargando(false);
    }
  };

  return (
    <div className="prediccion-container">
      <h1 className="prediccion-title">🔍 Predicción de Cancelación de Reserva</h1>
  
      <form onSubmit={handleSubmit} className="prediccion-form">
        <div>
          <label className="form-label">Número de Adultos</label>
          <input
            type="number"
            name="numAdultos"
            value={formData.numAdultos}
            onChange={handleChange}
            min="0"
            className="form-input"
          />
        </div>

        <div>
          <label className="form-label">Número de Niños</label>
          <input
            type="number"
            name="numNinos"
            value={formData.numNinos}
            onChange={handleChange}
            min="0"
            className="form-input"
          />
        </div>

        <div>
          <label className="form-label">Tipo de Habitación</label>
          <select
            name="tipoHabitacion"
            value={formData.tipoHabitacion}
            onChange={handleChange}
            className="form-input"
          >
            <option value="Suite">Suite</option>
            <option value="Doble">Doble</option>
            <option value="Simple">Simple</option>
          </select>
        </div>

        <div>
          <label className="form-label">Precio de la Habitación ($)</label>
          <input
            type="number"
            name="precioHabitacion"
            value={formData.precioHabitacion}
            onChange={handleChange}
            min="0"
            className="form-input"
          />
        </div>

        <div>
          <label className="form-label">Duración de la Estadía (días)</label>
          <input
            type="number"
            name="duracionEstadia"
            value={formData.duracionEstadia}
            onChange={handleChange}
            min="0"
            className="form-input"
          />
        </div>

        <div>
          <label className="form-label">Día de la Semana del Check-in</label>
          <select
            name="diaSemanaCheckIn"
            value={formData.diaSemanaCheckIn}
            onChange={handleChange}
            className="form-input"
          >
            <option>Monday</option>
            <option>Tuesday</option>
            <option>Wednesday</option>
            <option>Thursday</option>
            <option>Friday</option>
            <option>Saturday</option>
            <option>Sunday</option>
          </select>
        </div>

        <div>
          <label className="form-label">Mes del Check-in (1-12)</label>
          <input
            type="number"
            name="mesCheckIn"
            value={formData.mesCheckIn}
            onChange={handleChange}
            min="1"
            max="12"
            className="form-input"
          />
        </div>

        <div>
          <label className="form-label">Antigüedad de la Reserva (días)</label>
          <input
            type="number"
            name="antiguedadReserva"
            value={formData.antiguedadReserva}
            onChange={handleChange}
            min="0"
            className="form-input"
          />
        </div>

        <div className="prediccion-button-container">
          <button
            type="submit"
            className="prediccion-button"
            disabled={cargando}
          >
            {cargando ? (
              <>
                <span className="spinner"></span> Prediciendo...
              </>
            ) : 'Predecir'}
          </button>
        </div>
      </form>

      {resultado && (
        <div className="prediccion-resultado">
          <h2>Resultado:</h2>
          <p className={resultado === 'Si' ? 'resultado-si' : 'resultado-no'}>
            {resultado === 'Si'
              ? '❌ La reserva probablemente será cancelada'
              : '✅ La reserva probablemente se mantendrá'}
          </p>
        </div>
      )}
    </div>
    
  );



  
}
